import React, {Component} from 'react';
import Title from './title.js'
import Photowall from './photowall.js'

class Main extends Component
{
    constructor()
    {
        super();
        this.state ={ posts: [
            {
                id:"0",
                description:"rose",
                link:"data:image/jpeg;base64,"
            },
            {
                id:"1",
                description:"sunflower",
                link:"data:image/jpeg;base64,"
            },
            {
                id:"2",
                description:"lotus",
                link:"data:image/jpeg;base64,"
            }
        ]
    };
    this.remove = this.remove.bind(this);
}

remove(removePost)
{
    console.log(removePost.description);
    this.setState((state)=>({ posts: state.posts.filter((post)=> post!==removePost)}))

    
}
    render()
    {
            return(<div>
            <Title data={'Photowall'}/>
            <Photowall post={this.state.posts} onRemove={this.remove} />
            </div>)
    }
   
}
export default Main